import React, { Fragment } from 'react';
import { View, Text } from 'react-native';

// Componetns
import ProfileTop from './ProfileTop';

function Login() {
	return (
		<Fragment>
			<ProfileTop />
			<Text>Login Screen</Text>
		</Fragment>
	);
}

export default Login;
